import React from "react";
import { useDispatch } from 'react-redux';
import './Refresh.css';
import '../lib/fontello-fb8b4c48/css/fontello.css'

function Refresh() {
    const dispatch = useDispatch();

    return (
        <React.Fragment>
            <div className="refresh_btn" onClick={() => {
                dispatch({ type: 'CHANGE_LETTERDATA', data: [] });
            }}>&#xe834</div>
        </React.Fragment>
    );
};

export default Refresh;
